import React from "react";

function MyName(props) {
    if (props.surname) {
        return <h2 style={{ color:"red" }}>Cześć, {props.name} {props.surname}</h2>
    } else {
        return <h2>Cześć {props.name}</h2>
    }
}

export default MyName;
